import React from 'react';
import './LoginPage.css'; // Hum is page ke liye alag CSS banayenge

function LoginPage() {
  return (
    // Yeh poore page ko center mein laayega
    <div className="login-page-container">
      
      {/* Yeh white color ka login box hai */}
      <div className="login-box">
        
        <h2>Login</h2>
        
        <form>
          {/* Username */}
          <div className="input-group">
            <label htmlFor="username">Username</label>
            <input type="text" id="username" placeholder="Enter your username                                                                                                                                                            (@iitj.co.in)" />
          </div>
          
          {/* Password */}
          <div className="input-group">
            <label htmlFor="password">Password</label>
            <input type="password" id="password" placeholder="Enter your password" />
          </div>
          
          {/* Login Button */}
          <button type="submit" className="login-button">Login</button>
        </form>
        
        {/* Signup Link */}
        <div className="signup-link">
          <p>New user? <a href="#">Sign up here</a></p>
        </div>
        
        {/* Admin/Security Links (jaisa aapne kaha, small-small) */}
        <div className="other-logins">
          <a href="#">Login as Admin</a> | <a href="#">Login as Security</a>
        </div>
        
      </div>
    </div>
  );
}

export default LoginPage;
